import React from "react";
import { Route, Switch } from "react-router-dom";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Switch>
        <Route exact path="/" />
        <Route exact path="/intro2" component={Intro2} />
        <Route exact path="/intro3" component={Intro3} />
        <Route exact path="/main" component={Main} />
        <Route exact path="/about_our_mission" component={Mission} />
        <Route exact path="/about_us" component={US} />
      </Switch>
      <h1>JFC Food Company website under construction</h1>
    </div>
  );
}

export default App;
